INSERT INTO `dts_comment` VALUES (1, 1181000, 0, '布料很厚实，触感不错，洗过之后不缩水不掉色', 1, 1, '[\"https://yanxuan.nosdn.127.net/218783173f303ec6d8766810951d0790.jpg\"]', 1, '2018-02-01 00:00:00', '2018-02-01 00:00:00', 0);
INSERT INTO `dts_comment` VALUES (2, 1181000, 0, '料子很舒服，凉凉的，配合蚕丝被，夏天很凉快~', 1, 1, '[\"https://yanxuan.nosdn.127.net/33978a0d6f56d94c45e4fc594b4b8606.jpg\"]', 1, '2018-02-01 00:00:00', '2018-02-01 00:00:00', 0);
INSERT INTO `dts_comment` VALUES (3, 1181000, 0, '一直喜欢粗布的床上用品。冬暖夏凉。这套看起来非常漂亮。实际感觉有点粗布的感觉。很好！', 1, 1, '[\"https://yanxuan.nosdn.127.net/d3975d1b6d88e9f9d762cd9a879d1a14.jpg\"]', 1, '2018-02-01 00:00:00', '2018-02-01 00:00:00', 0);
INSERT INTO `dts_comment` VALUES (4, 1006002, 0, '3899床，2399白鹅绒被，899四件套。网易严选我要疯了！', 1, 1, '[\"https://yanxuan.nosdn.127.net/7215309e93c48cca08ca6910194eb3b0.jpg\"]', 1, '2018-02-01 00:00:00', '2018-02-01 00:00:00', 0);
INSERT INTO `dts_comment` VALUES (5, 1006002, 0, '漂亮', 1, 1, '[\"http://yanxuan.nosdn.127.net/d85a556893919038b56a95b71c9a1228.jpg\"]', 1, '2018-02-01 00:00:00', '2018-02-01 00:00:00', 0);
INSERT INTO `dts_comment` VALUES (6, 1006002, 0, '四件套已经收到 还没使用 不过手感很好 也没异味 相信严选的眼光  应该不会让我失望的', 1, 0, '[]', 1, '2018-02-01 00:00:00', '2018-02-01 00:00:00', 0);
INSERT INTO `dts_comment` VALUES (7, 1006002, 0, '这个很沉，但是同一套既有白色又有深蓝色，我用了吸色布，才避免染色，根本不敢一起洗，，，，', 1, 0, '[]', 1, '2018-02-01 00:00:00', '2018-02-01 00:00:00', 0);
INSERT INTO `dts_comment` VALUES (8, 1006002, 0, '特别喜欢的床品。漂亮', 1, 0, '[]', 1, '2018-02-01 00:00:00', '2018-02-01 00:00:00', 0);
INSERT INTO `dts_comment` VALUES (9, 1006002, 0, '还没有使用，看起来还不错', 1, 0, '[]', 1, '2018-02-01 00:00:00', '2018-02-01 00:00:00', 0);
