INSERT INTO `dts_comment` VALUES (938, 1181000, 0, '高品质的网易严选表现，高逼格的包装，文艺范的表现，实在耐用的使用性质，推荐，推荐哦', 1, 0, '[]', 1, '2018-02-01 00:00:00', '2018-02-01 00:00:00', 0);
INSERT INTO `dts_comment` VALUES (939, 1181000, 0, '不错啊，稍微有点味道，放了两天就OK了，躺上去很舒服，第一次在网易购物，送货很快，性价比很高', 1, 0, '[]', 1, '2018-02-01 00:00:00', '2018-02-01 00:00:00', 0);
INSERT INTO `dts_comment` VALUES (940, 1181000, 0, '睡在上面特别实在，身体的每个部位都被托着。老公说睡醒后身上再不会有酸痛了。于是再次回购。', 1, 0, '[]', 1, '2018-02-01 00:00:00', '2018-02-01 00:00:00', 0);
INSERT INTO `dts_comment` VALUES (941, 1181000, 0, '我一个女孩子，说实话，套套子的时候有点费劲，床垫挺沉的，不过睡着是真舒服，也没什么异味，不想起床', 1, 0, '[]', 1, '2018-02-01 00:00:00', '2018-02-01 00:00:00', 0);
INSERT INTO `dts_comment` VALUES (942, 1181000, 0, '这个记忆棉床垫我觉得还不错，比一般的床垫舒服，比较贴合身体能够给予足够的支撑。', 1, 0, '[]', 1, '2018-02-01 00:00:00', '2018-02-01 00:00:00', 0);
INSERT INTO `dts_comment` VALUES (943, 1181000, 0, '味道放了一周，不错了', 1, 0, '[]', 1, '2018-02-01 00:00:00', '2018-02-01 00:00:00', 0);
INSERT INTO `dts_comment` VALUES (944, 1181000, 0, '昨晚铺上床，试睡了一下，真的太舒服了，严选的东西真的是物美价廉！', 1, 0, '[]', 1, '2018-02-01 00:00:00', '2018-02-01 00:00:00', 0);
INSERT INTO `dts_comment` VALUES (945, 1181000, 0, '这个床单强烈推荐，十周年800元。\n睡着非常舒服，家里有榻榻米的可以考虑下。', 1, 0, '[]', 1, '2018-02-01 00:00:00', '2018-02-01 00:00:00', 0);
INSERT INTO `dts_comment` VALUES (946, 1181000, 0, '不错，这种慢性回弹刚躺上去不习惯，但醒来后不会有腰背酸痛。', 1, 0, '[]', 1, '2018-02-01 00:00:00', '2018-02-01 00:00:00', 0);
INSERT INTO `dts_comment` VALUES (947, 1181000, 0, '不好意思，早就收到货了，一直忘了确认！茶香很正！睡时间长腰疼~总体不错！', 1, 0, '[]', 1, '2018-02-01 00:00:00', '2018-02-01 00:00:00', 0);
INSERT INTO `dts_comment` VALUES (948, 1181000, 0, '抱歉，第一次被严选伤害到。收到床垫很快还蛮开心的的，看了说明书说散散味再用，放了两天可能正好遇到阴雨天吧，也没有暴晒。也可能房间小，不够通风。今早醒来头晕目眩，上吐下泻，俨然一副中毒的迹象。真心第一次被网易的产品给伤害，是不是碰上搞活动，产品质量把关不严了', 1, 1, '[\"https://yanxuan.nosdn.127.net/c4110c2c5355951cd1072ef50cb3d747.jpg\", \"https://yanxuan.nosdn.127.net/fe5793902da1d1c699b74b89246a2b36.jpg\"]', 1, '2018-02-01 00:00:00', '2018-02-01 00:00:00', 0);
INSERT INTO `dts_comment` VALUES (949, 1181000, 0, '不错 就是味儿大', 1, 0, '[]', 1, '2018-02-01 00:00:00', '2018-02-01 00:00:00', 0);
INSERT INTO `dts_comment` VALUES (950, 1181000, 0, '收到货物时开箱一看，居然是这样。被刮开了一个口子。心疼。想要退货，联系客服还没人理。。。\n这种体验真的不好', 1, 1, '[\"https://yanxuan.nosdn.127.net/4ac4120ce2686db84fd0147a53497f5a.jpg\", \"https://yanxuan.nosdn.127.net/fb39c5ecdb034a4a9444fa84c6916fe8.jpg\"]', 1, '2018-02-01 00:00:00', '2018-02-01 00:00:00', 0);
INSERT INTO `dts_comment` VALUES (951, 1181000, 0, '晾咯两天才没有味道，真的很舒服，感觉整个身体都会被贴合的很好，买的很值，第一次买严选很值！！！！！！', 1, 0, '[]', 1, '2018-02-01 00:00:00', '2018-02-01 00:00:00', 0);
INSERT INTO `dts_comment` VALUES (952, 1181000, 0, '一开始有味道，放了一个礼拜就好了，挺舒服的，性价比不错。', 1, 0, '[]', 1, '2018-02-01 00:00:00', '2018-02-01 00:00:00', 0);
INSERT INTO `dts_comment` VALUES (953, 1181000, 0, '还没打开使用，但是看能卷起来小小的一盒，就很喜欢，方便携带', 1, 0, '[]', 1, '2018-02-01 00:00:00', '2018-02-01 00:00:00', 0);
INSERT INTO `dts_comment` VALUES (954, 1181000, 0, '比预想的还要好，铺在榻榻米垫上睡觉舒适感提升', 1, 0, '[]', 1, '2018-02-01 00:00:00', '2018-02-01 00:00:00', 0);
